import React from 'react';

// Wrapper
import Section from '../components/Section';
import SectionOverflow from '../components/SectionOverflow';
import ExploreHeader from '../components/ExploreHeader';
import ExploreSection from '../components/ExploreSection';

export default () => {
  return (
    <>
      <ExploreHeader type='Experiences' />
      <div className='md:px-0 max-w-90% xl:px-0 mx-auto py-5'>
        <p style={{ fontFamily: 'airbnb-bold' }} className='text-xs'>
          AIRBNB EXPERIENCES
        </p>
        <h3 className='text-xl'>One-of-a-kind activities hosted by locals</h3>
      </div>
    </>
  );
};
